import React, { Component } from "react";
import StackGrid from "react-stack-grid";
import '../sass/components/_reset.scss';


class Portfolio extends Component {
  render() {
    return (
        <section>

        <StackGrid
        columnWidth={400}
        gutterWidth={10}
        gutterHeight={10}
        appearDelay={300}
        itemComponent="section"
        monitorImagesLoaded={true}
      >
        <article key="key1">
            <img src="" alt="yunt"/>
        </article>

        <article key="key2">
            <img src="" alt="WaveRadio"/>
        </article>

        <article key="key3">
            <img src="" alt="Baskerville"/>
        </article>

        <article key="key4">
            <img src="" alt="Warner France"/>
        </article>

        <article key="key5">
            <img src="" alt="Warner France"/>
        </article>

        <article key="key6">
            <img src="" alt="Marvel"/>
        </article>

        <article key="key7">
            <img src="" alt="Géode"/>
        </article>


